const Header = (props) => (
  <h1>{props.course}</h1>
)

const Content = (props) => (
<p>
  {props.part} {props.exercisesAmount}
</p>
)

const Total = (props) => {
  return (
    <p>Anzahl von Aufgaben {props.sum}</p>
  )

}


const App = () => {
  const course = 'Half Stack application development'

  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course="Half Stack application development" />
      <Content part='Fundamentals of React' exercisesAmount={exercises1} />
      <Content part={part2} exercisesAmount={exercises2} />
      <Content part={part3} exercisesAmount={exercises3} />
      <Total sum={exercises1 + exercises2 + exercises3} />
    </div>
  )
}

export default App
